css:
.dhx_scale_holder_now, .dhx_now .dhx_month_head, .dhx_now .dhx_month_body { background-color: #bdd4d3;}
.dhx_after .dhx_month_body, .dhx_before .dhx_month_body, .dhx_after .dhx_month_head, .dhx_before .dhx_month_head { background-color: #f7f6f2; }
.dhx_cal_container {
    font-family: "verdana";
}

.dhx_cal_event .dhx_body, .dhx_cal_event .dhx_footer, .dhx_cal_event .dhx_header, .dhx_cal_event .dhx_title {
    color: black;
    background-color: #f7f6f2;
    border: 1px solid black;
}

.dhx_scale_holder_now {
    background-color: #bdd4d3;
    background-image: none;
    opacity: 0.5;
}
